"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PI%2F60399&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
