"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Mechanism of epitope spreading",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 384px; height: 534px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This schematic shows the putative mechanism of epitope spreading, a process whereby one autoantibody profile may evolve into another. At the top of the figure, multiple epitopes of a polypeptide antigen are shown as differently colored boxes. After the polypeptide antigen is processed intracellularly by an antigen presenting cell, a small peptide fragment (orange square) is presented to a Th 1 cell (blue cell). The T cell responds to the peptide by releasing cytokines which stimulates a B cell (green cell) to produce antibodies to the peptide fragment and express antigen specific immunoglobulins on the cell surface. Surface immunoglobulin subsequently recognizes the intact antigen and the antigen is internalized and processed by the B cell acting as an antigen presenting cell. A new peptide epitope (blue square) may then be presented via a HLA molecule to a T cell (red cell) with a different antigen specificity, thereby initiating the production of different antibodies to a new epitope of the same antigen.",
